import React from 'react'

function Header(){
    const client = "Mohammed";
    const title = {
        x: "Cars",
        programmer: "medo"
    }

    const info = {
        name: "Nour",
        nick: "Homsi"
    }

    return(
        <div className="navbar bg-dark rounded text-white">
            Hello {`${info.name} ${info.nick}`}
            <h2>
                {client === "Mohammed" ? title.x : title.programmer} are my life.
            </h2>
        </div>
    );
}

export default Header;
